                <div className="resultTitle text-center text-light ">
                    <h1 className='bg-dark'>Что даст вашему бизнесу </h1>
                    <h1 className='text-light'>внедрение Digital-инструментов</h1>
                </div>
            </div>
    </div>
  )
}
